import React, { useState } from "react";
import { Container, Table } from "react-bootstrap";
import NavbarComp from "../../../components/navbar/NavbarComp";
import styletb from "./styletbl.module.css";
import { Link } from "react-router-dom";
import ic from "../../../assets/icons/Vector.png";
import DetailOrder from "../../../components/modals/DetailOrder";
function TransactionAdm() {
  const order = JSON.parse(localStorage.getItem("ordertrip"));
  const [modal, setModal] = useState(false);
  const handleModal = () => {
    setModal(true);
  };
  return (
    <>
      <NavbarComp />
      <Container>
        <div className={styletb.tb}>
          <h2>Incoming Transaction</h2>
          <Table responsive>
            <thead>
              <tr>
                <th>No</th>
                <th>User</th>
                <th>Trip</th>
                <th>Bukti Transfer</th>
                <th>Status Payment</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {order?.userorder !== "" ? (
                order?.map((item, idx) => (
                  <tr key={idx}>
                    <td>{idx + 1}</td>
                    <td>{item?.userorder}</td>
                    <td>{item?.title}</td>
                    <td>-</td>
                    <td>
                      {item?.status === "waiting payment" ? (
                        <span className={styletb.pd}>Pending</span>
                      ) : (
                        item?.status === "approve"(<span>Approve</span>)
                      )}
                    </td>
                    <td>
                      <img
                        src={ic}
                        alt="logodetailorder"
                        onClick={handleModal}
                      />
                    </td>
                  </tr>
                ))
              ) : (
                <span></span>
              )}
            </tbody>
          </Table>
        </div>
      </Container>
      <DetailOrder handleShow={modal} handleClose={() => setModal(false)} />
    </>
  );
}

export default TransactionAdm;
